INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BODI', 'STOCK', 'The Beachbody Company, Inc.', 'NYQ', 'Communication Services', 'Internet Content & Information', 'The Beachbody Company, Inc. is a fitness and nutrition company providing fitness, nutrition and stress-reducing programs to its customers. The Company''s products include digital subscriptions, nutritional products and connected fitness products. Its digital subscriptions include BOD and a live interactive premium subscription, BODi. Its digital platforms provide a one-stop-shop for all types of fitness and nutrition content, with brands such as P90X, Insanity, 21 Day Fix, 80 Day Obsession, Morning Meltdown 100, LIIFT4, Unstress Meditations, Portion Fix, 4 Weeks of Focus, Sure Thing, Dig Deeper, and others. The Beachbody On Demand Interactive (BODi) platform gives users access to comprehensive, highly produced, and creatively diverse fitness content with dynamic trainers. Its nutritional products include Shakeology, Beachbody Performance supplements, BEACHBARs and others. Its digital subscription offerings are complemented by its connected fitness products acquired from Myx.', 'El Segundo, CA, United States', 355);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AOMN', 'STOCK', 'Angel Oak Mortgage REIT, Inc. 9', 'NYQ', NULL, NULL, 'Angel Oak Mortgage REIT, Inc. is a real estate investment trust (REIT) focused on acquiring and investing in first lien non-qualified residential mortgage (non-QM) loans and other mortgage-related assets in the United States mortgage market. Its objective is to generate attractive risk-adjusted returns for its stockholders through cash distributions and capital appreciation across interest rate and credit cycles. Its strategy is to make credit-sensitive investments in newly originated first lien non-QM loans that are primarily made to non-QM loan borrowers and primarily sourced from its mortgage lending platform, Angel Oak Mortgage Lending, which operates through a wholesale channel and has a national origination. It may also invest in other residential mortgage loans, residential mortgage-backed securities (RMBS), and other mortgage-related assets, which, collectively with non-QM loans, are referred to as target assets. It is managed and advised by Falcons I, LLC (the Manager).', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVXC', 'STOCK', 'Avantis Emerging Markets Ex-China Equity ETF', 'NGM', NULL, NULL, 'Under normal market conditions, the fund will invest at least 80% of its assets in equity securities of companies related to emerging market countries, excluding those domiciled in China. The fund''s managers consider an emerging market country to be any country other than a developed country.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FSFG', 'STOCK', 'First Savings Financial Group, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'First Savings Financial Group, Inc. is the holding company for First Savings Bank (the Bank). The Company''s principal business activity is the ownership of the outstanding common stock of the Bank. The Bank is an entrepreneurial community bank and operates about 15 depository branches within Southern Indiana. The Bank also has two national lending programs, including single-tenant net lease commercial real estate and SBA lending, with offices located predominately in the Midwest. The Bank attracts deposits from the general public and uses those funds to originate primarily residential and commercial mortgage loans. The Bank also originates commercial business loans, residential and commercial construction loans, multifamily loans, land and land development loans, and consumer loans. The Bank conducts its lending and deposit activities primarily with individuals and small businesses in its primary market area, except as otherwise discussed herein.', 'Jeffersonville, IN, United States', 250);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHSCN', 'STOCK', 'CHS Inc.', 'NMS', 'Consumer Defensive', 'Farm Products', 'CHS Inc. is an integrated agricultural company, which provides grain, food, agronomy and energy resources to businesses and consumers on a global basis. It provides a variety of products and services, ranging from initial agricultural inputs such as fuels, farm supplies, crop nutrients and crop protection products to agricultural outputs that include grain and oilseed, processed grain and oilseed, renewable fuels and food products. It operates through three segments: Energy, Ag and Nitrogen Production. Its Energy segment produces and sells (primarily wholesale) gasoline, diesel fuel, propane, asphalt, lubricants and other related products, and also provides transportation services. Its Ag segment includes global grain and processing, ag retail and wholesale agronomy businesses. Its Nitrogen Production segment consists of its equity method investment in CF Industries Nitrogen, LLC (CF Nitrogen), which produces nitrogen-based products, including methanol, UAN, urea and related products.', 'Inver Grove Heights, MN, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIPJ', 'STOCK', 'Brookfield Infrastructure Finance ULC', 'NYQ', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALDF', 'STOCK', 'Aldel Financial II Inc.', 'NGM', 'Financial Services', 'Shell Companies', 'Aldel Financial II Inc. is a blank check company. The Company is formed for the purpose of effecting a merger, share exchange, asset acquisition, share purchase, reorganization or similar business combination with one or more businesses. It intends to focus on businesses in the financial services industry. The Company has not commenced its business operations and has not generated any revenue.', 'Itasca, IL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNEY', 'STOCK', 'CN Energy Group. Inc.', 'NCM', 'Basic Materials', 'Specialty Chemicals', 'CN Energy Group Inc is a China-based holding company mainly produces and supplies wood-based activated carbon. The Company also produces biomass electricity generated in the process of producing activated carbon and provides technical service. The Company''s products are primarily used in pharmaceutical manufacturing, industrial manufacturing, water purification, environmental protection, as well as food and beverage production fields.', 'Lishui City, , China', 24);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOLT', 'STOCK', 'Bolt Biotherapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Bolt Biotherapeutics, Inc. is a clinical-stage biopharmaceutical company developing immunotherapies for the treatment of cancer. The Companys pipeline includes BDC-3042, an agonist antibody that activates macrophages by targeting dectin-2, and BDC-4182, a next generation Boltbody Immune-Stimulating Antibody Conjugate (ISAC) clinical candidate targeting claudin 18.2. BDC-3042 is in a Phase I dose escalation trial that includes patients with any of seven different solid tumor types. The Companys Boltbody ISAC platform technology combines tumor-targeting antibodies with immune-stimulating linker-payloads. It has two additional ISAC programs utilizing its Boltbody ISAC technology platform in preclinical development. One is a Boltbody ISAC targeting carcinoembryonic antigen cell adhesion molecule 5 (CEA). Its final Boltbody ISAC program targets PD-L1. The Company is also developing additional Boltbody ISACs in strategic collaborations with biopharmaceutical companies.', 'Redwood City, CA, United States', 52);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FAMI', 'STOCK', 'Farmmi, Inc.', 'NCM', 'Consumer Defensive', 'Packaged Foods', 'Farmmi Inc is a holding company principally engaged in the processing and sales of a variety of mushrooms, edible fungi and other agricultural products. The Companys main products include edible fungi (edible mushroom), shiitake, mu er, bamboo fungi, agrocybe aegerila, pleurotus eryngii, grifola frondosa and other agricultural products such as crab, orange, rice and others. The Company is also engaged in logistics services. The Company mainly operates its businesses in the domestic and overseas markets.', 'Lishui, , China', 42);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BELFA', 'STOCK', 'Bel Fuse Inc.', 'NMS', 'Technology', 'Electronic Components', 'Bel Fuse Inc. designs, manufactures and markets a range of products that power, protect and connect electronic circuits. Its segments include Power Solutions and Protection, Connectivity Solutions and Magnetic Solutions. Power Solutions and Protection Segment includes internal and external AC/DC power supplies, DC/DC converters and DC/AC inverters utilized in defense, commercial aerospace, industrial, networking and consumer applications. Connectivity Solutions Segment includes high speed and harsh environment copper and optical fiber connectors and integrated assemblies, providing connectivity solutions within the commercial aerospace, military communications, defense, network infrastructure, structured building cabling and several industrial applications. Its magnetics solutions product line includes integrated connector modules (ICMs), power transformers, surface mount device (SMD) power inductors and switch mode power supply (SMPS) transformers, and discrete components-ethernet.', 'West Orange, NJ, United States', 5370);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AUUD', 'STOCK', 'Auddia Inc.', 'NCM', 'Technology', 'Software - Application', 'Auddia Inc. is an artificial intelligence (AI) technology company. The Company is focused on how consumers engage with audio through the development of its faidr app, an industry-first audio platform, which utilizes proprietary AI technology to personalize and customize both radio and podcast listening experiences. Its faidr allows users to listen to amplitude modulation (AM)/ frequency modulation (FM) radio stations without unwanted commercial breaks. The app replaces these ad breaks in real time with streaming music similar in format and genre to the radio station being played. The faidr app represents the first-time consumers can combine the local content provided by AM/FM radio. Its faidr includes podcasts and exclusive content, which includes new artist discovery, curated music stations and exclusive music podcasts. Users of faidr can also access any podcast thats publicly available and exclusive programming, music stations and Music Casts, through its exclusive content offering.', 'Boulder, CO, United States', 12);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPBI', 'STOCK', 'Central Plains Bancshares, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Central Plains Bancshares, Inc. is a holding company for Home Federal Savings and Loan Association of Grand Island, which operates under the name Home Federal Bank (the Bank). Home Federal Bank is a federally chartered stock savings association whose primary business consists of accepting deposits from the general public and investing those deposits, together with funds generated from operations, in one- to four-family residential mortgage loans secured by properties located in its primary market area the Grand Island, Nebraska, as well as commercial real estate loans. It also originates commercial non-real estate loans, multi-family residential real estate loans, construction and land development loans, agricultural real estate and non-real estate loans and consumer loans. The Bank offers a range of deposit accounts, including checking accounts, savings accounts and certificate of deposit accounts.', 'Grand Island, NE, United States', 68);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNH', 'STOCK', 'NASDAQ DM Ex US Industrials Ind', 'NYQ', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACNB', 'STOCK', 'ACNB Corporation', 'NCM', 'Financial Services', 'Banks - Regional', 'ACNB Corporation is the financial holding company for the wholly owned subsidiaries of ACNB Bank, and ACNB Insurance Services, Inc. ACNB Bank serves its marketplace with banking and wealth management services, including trust and retail brokerage, via a network of approximately 35 community banking offices and two loan offices located in the Pennsylvania counties of Adams, Cumberland, Franklin, Lancaster and York and the Maryland counties of Baltimore, Carroll and Frederick. It offers various loans, including personal loans, mortgage loans, auto loans and student loans. Its banking products and services include checking, savings, and debit and credit card services. ACNB Insurance Services, Inc. is a full-service insurance agency with licenses in around 46 states. The agency offers a range of property, casualty, health, life and disability insurance serving personal and commercial clients through office locations in Westminster and Jarrettsville, Maryland, and Gettysburg, Pennsylvania.', 'Gettysburg, PA, United States', 391);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNET', 'STOCK', 'ZW Data Action Technologies Inc.', 'NCM', 'Communication Services', 'Advertising Agencies', 'ZW Data Action Technologies Inc is a China-based holding company. The Company mainly provides a one-stop services for its clients on its Omni-channel advertising, precision marketing and data analysis management system. The Company''s main businesses include distributing the right to use search engine marketing service to increase the sales lead conversion rate for its clients'' business promotion, selling Internet advertising space on its advertising portals and providing related data service to its clients through the Internet advertising management systems, and providing other e-commerce advertising and marketing and related value-added technical services. The Company is also engaged in development of blockchain industry and the related technology.', 'Central, , Hong Kong', 25);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FDCF', 'STOCK', 'Fidelity Disruptive Communications ETF', 'NGM', NULL, NULL, 'The fund normally invests at least 80% of assets in securities of disruptive communications companies. Fidelity''s disruptive strategies seek to identify innovative developments that could signal new directions for delivering products and services to customers. Generally, these companies have or are developing new or unconventional ways of doing business that could disrupt and displace incumbents over time. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EHLS', 'STOCK', 'Even Herd Long Short ETF', 'NGM', NULL, NULL, 'The fund, an actively-managed ETF, seeks to achieve its investment objective by taking both long and short positions in equity securities. Even Herd, LLC, the fund’s sub-adviser, employs its proprietary algorithm to manage the fund’s portfolio, seeking to maintain a consistent 100% long exposure to equity securities. In addition, the fund’s short exposure will vary between 10% to 90%.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECCU', 'STOCK', 'Eagle Point Credit Company Inc.', 'NYQ', NULL, NULL, 'Eagle Point Credit Company Inc. is an externally managed, non-diversified closed-end management investment company. The Companys primary investment objective is to generate high current income, with a secondary objective to generate capital appreciation. The Company seeks to achieve its investment objectives by investing primarily in equity and junior debt tranches of collateralized loan obligations (CLOs) that are collateralized by a portfolio consisting primarily of below investment grade United States senior secured loans with a large number of distinct underlying borrowers across various industry sectors. The Company invests in various industries, including technology: software and services, media; hotels, restaurants and leisure; health care providers and services; diversified financial services; commercial services and supplies; diversified telecommunication services; professional services; insurance, and chemicals.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECCW', 'STOCK', 'Eagle Point Credit Company Inc.', 'NYQ', NULL, NULL, 'Eagle Point Credit Company Inc. is an externally managed, non-diversified closed-end management investment company. The Companys primary investment objective is to generate high current income, with a secondary objective to generate capital appreciation. The Company seeks to achieve its investment objectives by investing primarily in equity and junior debt tranches of collateralized loan obligations (CLOs) that are collateralized by a portfolio consisting primarily of below investment grade United States senior secured loans with a large number of distinct underlying borrowers across various industry sectors. The Company invests in various industries, including technology: software and services, media; hotels, restaurants and leisure; health care providers and services; diversified financial services; commercial services and supplies; diversified telecommunication services; professional services; insurance, and chemicals.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AQNB', 'STOCK', 'Algonquin Power & Utilities Cor', 'NYQ', NULL, NULL, 'Algonquin Power & Utilities Corp. is a Canada-based diversified international generation, transmission, and distribution company. The Company is engaged in providing sustainable energy and water solutions through its portfolio of generation, transmission and distribution utility investments to over one million customer connections. The Company''s operations are organized across three business units, consisting of: the Regulated Services Group, which primarily owns and operates a portfolio of regulated electric, water distribution and wastewater collection and natural gas utility systems and transmission operations in the United States, Canada, Bermuda and Chile; the Hydro Group, consisting of the hydroelectric business, which is not being sold as a part of the Renewables sale; and the Corporate Group, which includes corporate and service companies as well as its investment in Atlantica.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FTXN', 'STOCK', 'First Trust Nasdaq Oil & Gas ETF', 'NGM', NULL, NULL, 'The fund will normally invest at least 90% of its net assets (including investment borrowings) in the securities that comprise the index. The index is designed to provide exposure to U.S. companies comprising the oil and gas sector that have been selected based upon their liquidity and ranking. It is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EICB', 'STOCK', 'Eagle Point Income Company Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Eagle Point Income Company Inc. is an externally managed, diversified closed-end management investment company. The Companys primary investment objective is to generate high current income, with a secondary objective to generate capital appreciation. The Company seeks to achieve these objectives by investing primarily in junior debt tranches of collateralized loan obligations (CLOs) rated BB. In addition, the Company may invest up to 35% of its total assets (at the time of investment) in CLO equity securities and other securities and instruments that are consistent with its investment objectives. The Company may also invest in other securities and instruments objectives such as securities issued by other securitization vehicles. The Company may also invest in other junior debt tranches of CLOs, senior debt tranches of CLOs, loan accumulation facilities (LAF) and other related securities and instruments. The investment advisor of the Company is Eagle Point Income Management LLC.', 'Greenwich, CT, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WSBCP', 'STOCK', 'WesBanco, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Wesbanco, Inc. is a diversified multi-state bank holding company. The Company offers a full range of financial services, including retail banking, corporate banking, personal and corporate trust services, brokerage services, mortgage banking and insurance. Its segments include community banking and trust and investment services. The community banking segment offers services traditionally offered by full-service commercial banks, including commercial demand, individual demand and time deposit accounts, as well as commercial, mortgage and individual installment loans, and certain non-traditional offerings, such as insurance and securities brokerage services. The trust and investment services segment offers trust services as well as various alternative investment products, including mutual funds. It serves customers through more than 250 financial centers and loan production offices in Indiana, Kentucky, Maryland, Michigan, Ohio, Pennsylvania, Tennessee, Virginia, and West Virginia.', 'Wheeling, WV, United States', 3253);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AFGB', 'STOCK', 'American Financial Group, Inc. ', 'NYQ', NULL, NULL, 'American Financial Group, Inc. is an insurance holding company. Through the operations of Great American Insurance Group, the Company is engaged primarily in property and casualty insurance, focusing on specialized commercial products for businesses. The Companys segments include property and casualty insurance and Other. The property and casualty insurance business includes specialty sub-segments: property and transportation, which includes physical damage and liability coverage for buses and trucks and other specialty transportation niches, inland and ocean marine, agricultural-related products and other commercial property coverage; specialty casualty, which includes primarily excess and surplus, executive and professional liability, general liability, umbrella and excess liability, and specialty financial, which includes risk management insurance programs for lending and leasing institutions, fidelity and surety products and trade credit insurance.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNJ', 'STOCK', 'Brookfield Finance Inc. 4.50% P', 'NYQ', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FID', 'STOCK', 'First Trust S&P International Dividend Aristocrats ETF', 'NGM', NULL, NULL, 'Under normal conditions, the fund will invest at least 90% of its net assets (including investment borrowings) in the equity securities that comprise the index. The index measures the performance of high dividend yielding companies that have followed a managed-dividends policy of increasing or maintaining dividends for at least ten consecutive years.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DHCNI', 'STOCK', 'Diversified Healthcare Trust  -', 'NMS', NULL, NULL, 'Diversified Healthcare Trust is a real estate investment trust (REIT). The Company is focused on owning healthcare properties located throughout the United States. It has an approximately $7.2 billion portfolio, which includes over 367 properties in 36 states and Washington, D.C., occupied by approximately 450 tenants, and totaling approximately 8.0 million square feet of life science and medical office properties and more than 27,000 senior living units. The Company''s segments include Medical Office and Life Science Portfolio and SHOP. Its Medical Office and Life Science Portfolio segment primarily consists of medical office properties leased to medical providers and other medical-related businesses, as well as life science properties primarily leased to biotech laboratories and other similar tenants. Its SHOP segment consists of managed senior living communities that provide short-term and long-term residential living and, in some instances, care and other services for residents.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FGN', 'STOCK', 'F&G Annuities & Life, Inc. 7.95', 'NYQ', NULL, NULL, 'F&G Annuities & Life, Inc. is a provider of insurance solutions serving retail annuity and life customers, as well as institutional clients. Through its subsidiaries, it markets a portfolio of annuities, including fixed indexed annuities (FIAs), registered index-linked annuities (RILAs), (referred to as indexed annuities), multi-year guarantee annuities (MYGAs) as well as pension risk transfer (PRT) solutions, indexed universal life (IUL) insurance and institutional funding agreements. Its retail annuities serve as a retirement and savings tool on which its customers rely for principal protection and predictable income streams. In addition, its life insurance products provide its customers with a complementary product that allows them to build on their savings and provide a payment to their designated beneficiaries upon the policyholder''s death. Its customers value its FIAs, which provide a portion of the gains of an underlying market index, while also providing principal protection.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EBIZ', 'STOCK', 'Global X E-commerce ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets in the securities of the underlying index. The index is designed to provide exposure to exchange-listed companies that are positioned to benefit from the increased adoption of e-commerce as a distribution model, including but not limited to companies whose principal business is in operating e-commerce platforms, providing e-commerce software and services, and/or selling goods and services online. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSPI', 'STOCK', 'CSP Inc.', 'NGM', 'Technology', 'Information Technology Services', 'CSP Inc. develops and markets information technology (IT) integration solutions, advanced security products, managed information technology services, cloud services, network adapters, and cluster computer systems. It operates in two segments: Technology Solutions (TS) and High Performance Products (HPP). The TS segment provides professional services for complex IT solutions, including advanced security; unified communications and collaboration; wireless and mobility; data center solutions, and network solutions, as well as managed IT services that primarily serve the small and mid-sized business market. The HPP segment includes the ARIA Software-Defined Security (SDS), which is offered to commercial, original equipment manufacturers (OEM) and government customers; the Myricom network adapters and related software for commercial, government and OEM customers, and the legacy Multicomputer product portfolio for digital signal processing (DSP) applications within the defense markets.', 'Lowell, MA, United States', 111);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXIL', 'STOCK', 'AXIL Brands, Inc.', 'ASE', 'Technology', 'Consumer Electronics', 'AXIL Brands, Inc. is a global e-commerce consumer products company. The Company is engaged in the manufacturing, marketing, sale and distribution of high-tech hearing and audio enhancement and protection products for people with various applications. The Company manufactures and markets premium hearing enhancement and protection products, including ear plugs, earmuffs, and ear buds, under the AXIL brand and premium hair and skincare products under its in-house Reviv3 Procare brand, selling products in the United States, Canada, the European Union and throughout Asia. The Company operates through two segments: hearing enhancement and protection, and hair care and skin care. Its products in this segment include GS Extreme sound enhancement and hearing protection ear buds with Bluetooth functionality, XCOR True Wireless, digital ear buds with touch control, TRACKR Blu advanced sound enhancement, hearing protection, and Bluetooth audio earmuffs and X-PRO passive ear protection.', 'Alhambra, CA, United States', 14);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCBG', 'STOCK', 'Capital City Bank Group, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Capital City Bank Group, Inc. is a financial holding company. The Company provides a full range of banking and banking-related services to individual and corporate clients through its wholly-owned subsidiary, Capital City Bank (the Bank). It provides a full range of banking services, including traditional deposit and credit services, mortgage banking, asset management, trust, merchant services, bankcards, securities brokerage services and financial advisory services, including the sale of life insurance, risk management, and asset protection services. The Company provides two principal services, including Banking Services and Wealth Management Services. It offers its customers access to retail investment products through LPL Financial, which includes a full line of retail securities products. The Bank has approximately 62 banking offices and 104 automated teller machines, ATMs/ interactive teller machines (ITMs) in Florida, Georgia, and Alabama.', 'Tallahassee, FL, United States', 940);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTFX', 'STOCK', 'CoinShares Bitcoin Leverage ETF', 'NGM', NULL, NULL, 'The fund is an ETF that seeks to achieve its investment objective by investing its assets primarily in cash-settled bitcoin futures contracts that trade only on an exchange registered with the CFTC which currently is the CME, and cash, cash-like instruments or high-quality securities that serve as collateral to the fund’s investments in Bitcoin Futures Contracts. It invests at least 80% of its net assets in Bitcoin Futures Contracts. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWSN', 'STOCK', 'Babcock & Wilcox Enterprises, I', 'NYQ', NULL, NULL, 'Babcock & Wilcox Enterprises, Inc. is a provider of renewable, environmental and thermal technologies for industrial, electrical utility, municipal and other customers. The Company operates through three segments: Babcock & Wilcox Renewable, Babcock & Wilcox Environmental, and Babcock & Wilcox Thermal. Its Babcock & Wilcox Renewable segment offers technologies for environmentally sustainable power and heat generation, including waste-to-energy, oxygen-fired biomass-to-energy and black liquor systems for the pulp and paper industry. Its Babcock & Wilcox Environmental segment provides emissions control and environmental technology solutions for utility, waste-to-energy, biomass-to-energy, carbon black, and industrial steam generation applications around the world. Its Babcock & Wilcox Thermal segment provides steam generation equipment, aftermarket parts, construction, maintenance and field services for plants in the power generation, oil and gas, and industrial sectors.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAUC', 'STOCK', 'Allied Gold Corporation', 'NYQ', 'Basic Materials', 'Gold', 'Allied Gold Corporation is a gold producer. It operates a portfolio of three producing assets and development projects located in Cote d''Ivoire, Mali, and Ethiopia. Its portfolio includes Sadiola Mine, Cote dIvoire Complex, and Kurmuk Project. The Sadiola Mine is an open pit gold mine, located in the Kayes region of Mali, and the Diba open pit gold mine, over 15 kilometers (km) south of the processing plant at Sadiola. The CDI complex includes the Agbaou and Bonikro mills, located only over 20 km from each other, along with several open pit deposits located in the prospective Birimian gold belt. Its Agbaou and Bonikro Mine is an open pit gold mine, located in the Oume region of Cote dIvoire. The Kurmuk Project is an advanced stage development project in the Benishangul-Gumuz region of Ethiopia. The project design encompasses the Dish Mountain and Ashashire deposits, with exploration targets across the Kurmuk Projects expansive over 1,450 square kilometers'' of exploration territory', 'Toronto, ON, Canada', 2252);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EEA', 'STOCK', 'The European Equity Fund, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'The European Equity Fund, Inc. is a closed ended equity mutual fund launched by Deutsche Investment Management Americas Inc. The fund is managed by Deutsche Asset Management International GmbH. It invests in the public equity markets of Europe. The fund seeks to invest in the stocks of companies operating across diversified sectors. It primarily invests in equity or equity-linked securities of companies. The fund seeks to benchmark the performance of its portfolio against the MSCI-EMU Index. It was formerly known as Germany Fund Inc. The European Equity Fund, Inc. was formed on July 23, 1986 and is domiciled in the United States.', 'Frankfurt am Main, , Germany', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLRO', 'STOCK', 'ClearOne, Inc.', 'NCM', 'Technology', 'Communication Equipment', 'ClearOne, Inc. is a global market company enabling conference, collaboration, and network streaming solutions. The Company designs, develops and sells conferencing, collaboration, and AV networking solutions for voice and visual communications. Its product categories include audio-conferencing, including installed DSP-based professional audio conferencing and USB-based speakerphones; professional microphones consisting of patented beamforming microphone arrays, ceiling microphones and wireless microphones, and video, including video collaboration and AV networking products. Its audio-conferencing products feature its proprietary HDConference, Distributed Echo Cancellation and noise cancellation technologies to enhance communication during a conference call by eliminating echo and background noise. Its professional conferencing products include the CONVERGE Pro 2 and CONVERGE Pro 2 SR product lines. Its premium conferencing offering consists of the CONVERGE Huddle product line.', 'Salt Lake City, UT, United States', 80);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CFBK', 'STOCK', 'CF Bankshares Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'CF Bankshares Inc. is a holding company of CFBank, National Association (CFBank). CFBank is a commercial bank, operating primarily in five major metro markets: Columbus, Cleveland, Cincinnati, and Akron, Ohio, and Indianapolis, Indiana. It provides commercial, retail, and mortgage lending services to businesses and entrepreneurs. CFBank provides commercial loans and equipment leases, commercial and residential real estate loans and treasury management depository services, residential mortgage lending, and full-service commercial and retail banking services and products. Its loan and lease portfolio primarily consists of commercial, commercial real estate and multi-family mortgage loans, mortgage loans secured by single-family residences and, to a lesser degree, consumer loans. CFBank also finances a variety of commercial and residential construction projects. CFBank also offers the convenience of online banking, mobile banking and remote deposit capabilities.', 'Columbus, OH, United States', 102);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELC', 'STOCK', 'Entergy Louisiana, LLC COLLATERAL TR MT', 'NYQ', NULL, NULL, 'Entergy Louisiana, LLC is a provider of electric services. The Company holds non-exclusive franchises to provide electric service in approximately 175 incorporated municipalities and in the unincorporated areas of approximately 58 parishes of Louisiana. The Company is a subsidiary of Entergy Corporation.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FXNC', 'STOCK', 'First National Corporation', 'NCM', 'Financial Services', 'Banks - Regional', 'First National Corporation is a bank holding company for First Bank (the Bank), which is a commercial bank. The Bank offers loan, deposit, and wealth management products and services. Its loan products and services include consumer loans, residential mortgages, home equity loans and commercial loans. Deposit products and services include checking accounts, treasury management solutions, savings accounts, money market accounts, certificates of deposit and individual retirement accounts. Wealth management services include estate planning, investment management of assets, trustee under an agreement, trustee under a will, individual retirement accounts and estate settlement. Its customers include small and medium-sized businesses, individuals, estates, local governmental entities, and non-profit organizations. It operates over 33 branches throughout the Shenandoah Valley, central regions of Virginia, and the Richmond and Roanoke market areas.', 'Strasburg, VA, United States', 303);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBU', 'STOCK', 'Brookfield Business Partners L.P.', 'NYQ', 'Industrials', 'Conglomerates', 'Brookfield Business Partners L.P. is a private equity firm specializing in growth capital, divestitures, and acquisitions. The firm typically invests in business services, infrastructure services, construction, energy, and industrials sector. The firm prefers to invest globally. It prefers to take majority controlling stake in companies. The firm seeks returns of at least 15%-20% on its investments. The firm was founded in 2016 and is based in Hamilton, Bermuda. Brookfield Business Partners L.P. operates as a subsidiary of Brookfield Corporation.', 'Hamilton, , Bermuda', 72000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DUKB', 'STOCK', 'Duke Energy Corporation 5.625% ', 'NYQ', NULL, NULL, 'Duke Energy Corporation é uma empresa de holding de energia. A empresa opera através de dois segmentos: Serviços Elétricos e Infra-estruturas (EU&I) e Serviços Públicos e Infra-estruturas de Gás (GU&I). O segmento EU&I realiza operações principalmente através das concessionárias públicas regulamentadas de Duke Energy Carolinas, Duke Energy Progress, Duke Energy Florida, Duke Energy Indiana e Duke Energy Ohio. A EU&I fornece serviço elétrico de varejo através da geração, transmissão, distribuição e venda de eletricidade para clientes nas regiões Sudeste e Centro-Oeste dos Estados Unidos. O segmento GU&I realiza operações de gás natural principalmente através das concessionárias públicas regulamentadas de Piedmont, Duke Energy Ohio e Duke Energy Kentucky. A Gu&I serve clientes residenciais, comerciais, industriais e de geração de energia de gás natural, incluindo clientes atendidos por municípios que são clientes grossistas. Também adquire um portfólio diversificado de serviços de transp', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('IBGA', 'STOCK', 'iShares iBonds Dec 2044 Term Treasury ETF', 'NGM', NULL, NULL, 'The fund seeks to meet its investment objective generally by investing in individual securities which satisfy the criteria of the index. The underlying index consists of publicly-issued U.S. Treasury securities that are scheduled to mature between January 1, 2044 and December 15, 2044, inclusive.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSSX', 'STOCK', 'Invesco Bulletshares 2033 Municipal Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment-grade municipal bonds with maturities or, in some cases, “effective maturities,” in the year 2033. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCEL', 'STOCK', 'Cryo-Cell International, Inc.', 'ASE', 'Healthcare', 'Medical Care Facilities', 'Cryo-Cell International, Inc. is a cord blood banking company. The Company operates through three segments: cellular processing and cryogenic storage for family use, with a focus on the collection and preservation of umbilical cord blood and tissue stem cells; manufacture of PrepaCyte CB Processing System (PrepaCyte CB) units, the processing technology used to process umbilical cord blood stem cells, and cellular processing and cryogenic storage of umbilical cord blood stem cells for public use. The Company stores approximately 240,000 cord blood and cord tissue specimens. The specimens are stored in commercially available cryogenic storage units at its technologically and operationally advanced facility. The Company markets its cord blood stem cell preservation services directly to expectant parents and by distributing information through obstetricians, pediatricians, childbirth educators, certified nurse-midwives, and other related healthcare professionals.', 'Oldsmar, FL, United States', 82);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPSS', 'STOCK', 'Consumer Portfolio Services, Inc.', 'NGM', 'Financial Services', 'Credit Services', 'Consumer Portfolio Services, Inc. is a specialty finance company. Its business is to provide purchase and service retail automobile contracts originated primarily by franchised automobile dealers and, to a lesser extent, by select independent dealers in the United States in the sale of new and used automobiles, light trucks, and passenger vans. Through its automobile contract purchases, it provides indirect financing to the customers of dealers. It serves as an alternative source of financing for dealers, facilitating sales to customers from traditional sources, such as commercial banks, credit unions, and the finance companies affiliated with automobile manufacturers. It also originates vehicle purchase money loans by lending directly to consumers. It offers over eight different financing programs and prices each program according to relative credit risk. Its financing programs include First Time Buyer, Mercury / Delta, Standard, Alpha, Alpha Plus, Super Alpha, Preferred, and Meta.', 'Las Vegas, NV, United States', 932);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDRO', 'STOCK', 'Codere Online Luxembourg, S.A.', 'NCM', 'Consumer Cyclical', 'Gambling', 'Codere Online Luxembourg SA is a Luxembourg-based Online Casino Operator Company. The Company offers Online Sports Betting and Online Casino through its state-of-the art website and Mobile Application. It operates in markets of Spain, Italy, Mexico, Colombia, Panama and the City of Buenos Aires (Argentina). The Company offers online Channels include Omnichannel and Pure Online. Its products include Sports Betting and Casino. The Company is also the official betting partner of Real Madrid in Latin America, River Plate in Argentina and Monterrey Rayados in Mexico.', 'Luxembourg, , Luxembourg', 325);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSWCZ', 'STOCK', 'Capital Southwest Corporation', 'NMS', NULL, NULL, 'Capital Southwest Corporation is an internally managed business development company. The Company is a market lending firm focused on supporting the acquisition and growth of middle market businesses with investments across the capital structure, including first lien, second lien and non-control equity co-investments. It specializes in providing customized debt and equity financing to lower middle market (LMM) companies in a broad range of investment segments located primarily in the United States. Its investment objective is to produce attractive risk-adjusted returns by generating current income from its debt investments and capital appreciation from its equity and equity-related investments. It invests primarily in first-lien debt securities, secured by security interests in portfolio company assets. It also invests in equity interests in its portfolio companies alongside its debt securities. It also offers managerial assistance to its portfolio companies.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FEMS', 'STOCK', 'First Trust Emerging Markets Small Cap AlphaDEX Fund', 'NGM', NULL, NULL, 'The fund will normally invest at least 90% of its net assets (including investment borrowings) in the securities that comprise the index. The index is designed to select stocks from the NASDAQ Emerging Markets Index (the "base index") that may generate positive alpha, or risk-adjusted returns, relative to traditional indices through the use of the AlphaDEX® selection methodology.', '', NULL);\n
